query SchemaInterfaceEditorQuery @skipAudit @engComponent(name: SCHEMAS) {
  currentTenantOrganizations {
    ... on OrganizationNode {
      ...OrganizationDefaultSchemaCollaboratorsConfiguration
      __typename
    }
    __typename
  }
}

fragment OrganizationDefaultSchemaCollaboratorsConfiguration on OrganizationNode {
  id
  handle
  name
  schemaCollaborationDefaultConfigurations {
    id
    schemaType
    defaultSchemaCollaborations {
      party {
        ... on PartyInterface {
          id
          name
          handle
          __typename
        }
        __typename
      }
      policy {
        id
        __typename
      }
      teamRole
      organizationRole
      __typename
    }
    __typename
  }
  __typename
}

query SchemaInterfaceQuery($id: StrictString!) @skipAudit @engComponent(name: SCHEMAS) {
  schemaInterface(id: $id) {
    ... on SchemaInterfaceNode {
      id
      name
      organization {
        id
        name
        urlIdentifier
        __typename
      }
      sqlIdentifier
      ... on PoliceableInterface {
        id
        permissions {
          ...SchemaPermissionsGraphQL
          __typename
        }
        __typename
      }
      schemas {
        ...TagSchemaGraphQL
        __typename
      }
      fields {
        id
        apiId
        systemName
        displayName
        fieldType
        isRequired
        isMulti
        isComputed
        schemaFieldSelectorId
        requiredLinkJson
        __typename
      }
      baseBioentityType {
        folderItemType
        sequenceType
        __typename
      }
      constraint {
        id
        fieldsJson
        status
        uniqueResidues
        areUniqueResiduesCaseSensitive
        uniqueCanonicalSmiles
        source {
          id
          name
          __typename
        }
        __typename
      }
      labelingStrategies
      prefix
      nameTemplates {
        linkedItemId
        templateType
        shouldOrderPartsBySequence
        nameTemplateParts {
          datetimeFormat
          fieldId
          text
          type
          __typename
        }
        __typename
      }
      __typename
    }
    ...HasArchiveRecordGraphQL
    __typename
  }
}

fragment TagSchemaGraphQL on TagSchemaNode {
  id
  allFieldsJson
  authParentOption
  batchSchema {
    id
    __typename
  }
  childEntitySchemas {
    iconId
    id
    name
    folderItemType
    sqlIdentifier
    sequenceType
    shouldCreateAsOligo
    archiveRecord {
      purpose
      __typename
    }
    __typename
  }
  constraint {
    ...TagSchemaConstraintGraphQL
    __typename
  }
  containableType
  fieldsJson
  folderItemType
  hoistedTagSchemaGraphsJson
  iconId
  includeRegistryIdInChips
  isContainable
  labelingStrategies
  mixtureSchemaConfig {
    allowMeasuredIngredients
    componentLotStorageEnabled
    componentLotTextEnabled
    __typename
  }
  name
  nameTemplateFields
  nameTemplateParts {
    datetimeFormat
    fieldId
    text
    type
    __typename
  }
  prefix
  registry {
    id
    __typename
  }
  sequenceType
  shouldCreateAsOligo
  shouldOrderNamePartsBySequence
  showResidues
  sqlIdentifier
  useOrganizationCollectionAliasForDisplayLabel
  useRandomOrgAlias
  permissions {
    ...SchemaPermissionsGraphQL
    __typename
  }
  archiveRecord {
    purpose
    __typename
  }
  __typename
}

fragment TagSchemaConstraintGraphQL on TagSchemaConstraintNode {
  id
  areUniqueResiduesCaseSensitive
  fieldsJson
  status
  uniqueResidues
  uniqueCanonicalSmiles
  source {
    id
    name
    __typename
  }
  __typename
}

fragment SchemaPermissionsGraphQL on PermissionsNode {
  admin
  appendable
  archivable
  definitionDeletable
  definitionEditable
  definitionListable
  objectsCreatable
  objectsRegisterable
  readable
  unarchivable
  writable
  __typename
}

fragment HasArchiveRecordGraphQL on HasArchiveRecordInterface {
  archiveRecord {
    purpose
    __typename
  }
  __typename
}
